import React, { useEffect } from 'react';
import Highcharts from 'highcharts';
import axios from 'axios';


const Bar =() =>{
    useEffect(() => {
        Highcharts.chart('BarGraph', {
          chart: {
            type: 'column',
            square: true,
            backgroundColor: 'Transparent',
          },
          title: {
            align: 'center',
            text: 'Total Amount Per Distribution Channel',
            style: {
                color: 'white',
              },
          },
          xAxis: {
            categories: ['Component'],
            visible: true,
            labels: {
                style: {
                  color: 'white',
                },
              },
          },
          yAxis: {
            title: {
              text: 'Value',
              style: {
                color: 'white',
              },
            },
            labels: {
                style: {
                  color: 'white',
                },
              },
          },
          series: [
            {
              name: 'Value',
              data: [102000],
              dataLabels: {
                enabled: true,
                color: 'white',
              },
            },
          ],
        });
      }, []);

      return(
        <div id="BarGraph"></div> 
      ); 
};

export default Bar;
